 We can use React Context to share the state between components.

Here is an example of how you can achieve this:

First, create a context file `tooltipContext.js`:
```js
import { createContext, useState } from 'react';

const TooltipContext = createContext();

const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = useState(null);

  const closeTooltip = () => {
    setTooltip(null);
  };

  return (
    <TooltipContext.Provider value={{ tooltip, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export { TooltipProvider, TooltipContext };
```
In this file, we create a context using `createContext` and a provider component `TooltipProvider` that wraps the children components and provides the `tooltip` and `closeTooltip` functions to them.

Next, create a `Tooltip` component that uses the context:
```js
import { useContext } from 'react';
import { TooltipContext } from './tooltipContext';

const Tooltip = ({ children, text }) => {
  const { tooltip, closeTooltip } = useContext(TooltipContext);

  const handleClick = () => {
    if (tooltip) {
      closeTooltip();
    } else {
      setTooltip(text);
    }
  };

  return (
    <div onClick={handleClick}>
      {children}
      {tooltip && (
        <div className="tooltip">
          <span>{tooltip}</span>
          <button onClick={closeTooltip}>Close</button>
        </div>
      )}
    </div>
  );
};

export default Tooltip;
```
In this component, we use the `useContext` hook to get the `tooltip` and `closeTooltip` functions from the context. We also define a `handleClick` function that checks if there is an open tooltip and closes it if there is, or sets the new tooltip if there isn't.

Finally, use the `TooltipProvider` component as the wrapper for your app and the `Tooltip` component wherever you want to display the tooltip:
```js
import React from 'react';
import { render } from 'react-dom';
import { TooltipProvider } from './tooltipContext';
import Tooltip from './Tooltip';

const App = () => {
  return (
    <TooltipProvider>
      <div>
        <Tooltip text="Hello World!">Hover me</Tooltip>
        <Tooltip text="Goodbye World!">Hover me again</Tooltip>
      </div>
    </TooltipProvider>
  );
};

render(<App />, document.getElementById('root'));
```
In this example, we wrap the `App` component with the `TooltipProvider` component and use the `Tooltip` component to display the tooltips. When you hover over the tooltips, they will open and close correctly, and only one tooltip will be open at a time.

