            byte[] getTempBytes = Encoding.ASCII.GetBytes(getTempMessage);
            stream.Write(getTempBytes, 0, getTempBytes.Length);

            bytesRead = stream.Read(buffer, 0, buffer.Length);
            string temperature = Encoding.ASCII.GetString(buffer, 0, bytesRead);
            Console.WriteLine("Temperature: " + temperature);
        }

        // Logout
        string logoutMessage = "LOGOUT";
        byte[] logoutBytes = Encoding.ASCII.GetBytes(logoutMessage);
