function packEntities(entities) {
    let buffer = new ArrayBuffer(entities.length * 7 / 8);
    let view = new DataView(buffer);
    for (let i = 0; i < entities.length; i++) {
        let entity = entities[i];
        view.setUint8(i * 7 / 8, (entity.id << 3) | entity.size);
    }
    return buffer;
}

function unpackEntities(buffer) {
    let view = new DataView(buffer);
    let entities = [];
    for (let i = 0; i < buffer.byteLength; i += 7 / 8) {
        let entity = {};
        entity.id = view.getUint8(i) >> 3;
        entity.size = view.getUint8(i) & 7;
        entities.push(entity);
    }
    return entities;
}
```

The `packEntities` function creates an `ArrayBuffer` with enough space to hold all the entities, then iterates over the entities, writing each one to the buffer in little-endian byte order. The `unpackEntities` function creates a `DataView` over the buffer, then iterates over the buffer, reading each entity from the buffer and creating a new object to hold its fields. The `id` field is extracted by shifting the byte value 3 bits to the right, and the `size` field is extracted by taking the remainder of the byte value when divided by 8. The `entities` array is then returned. 

Please note that the `packEntities` function assumes that the `entities` array is not empty. If the `entities` array is empty, the function will return an `ArrayBuffer` with a size of 0, which is not a valid buffer. The `unpackEntities` function assumes that the `buffer` is not null or undefined. If the `buffer` is null or undefined, the function will throw a `TypeError`. 

